import React from 'react';
import PostData from '../data/schoolProfiles.json';

function PostList() {
  return (
    <div>
      <h1 style ={{textAlign: "center", margin: 20 + 'px'}}>School Profiles</h1>
        <div class="row">
          {PostData.map((schoolProfile, index)=>{
            return <>
              <div class="col-sm">
                <div class="card" style={{width: 18+ 'rem'}}>
                  <div class="card-body">
                    <h5 class="card-title">{schoolProfile.name}</h5>
                    <h6 class="card-subtitle mb-2 text-muted">{schoolProfile.address}</h6>
                    <a href="#" class="btn btn-primary">Generate page</a>
                  </div>
                </div>
              </div>
            </>
          })}
      </div>
    </div>
  );
}

export default PostList;
